import Header from './components/Header';
import Nav from './components/Nav';
import Shopcarousel from './components/Shopcarousel';
import Shopmain from './components/Shopmain';
import Footer from './components/Footer';
import "./Shop.css"

const Shop = () =>{
    return(
        <div>
            <Header/>
            <Nav/>
            <Shopcarousel/>
            <Shopmain/>
            <Footer/>
        </div>
    )

}





export default Shop;
